import React from "react";
import "./FaceRecognition.css";

const FaceRecognition = ({ imageUrl, box }) => {
    const renderBoxes = () => {
        if (Array.isArray(box)) {
            return box.map((singleBox) => (
                <div
                    className='bounding-box'
                    style={{
                        top: singleBox.topRow,
                        right: singleBox.rightCol,
                        bottom: singleBox.bottomRow,
                        left: singleBox.leftCol,
                    }}
                ></div>
            ));
        } else if (box) {
            // Render a single box if box is not an array
            return (
                <div
                    className='bounding-box'
                    style={{
                        top: box.topRow,
                        right: box.rightCol,
                        bottom: box.bottomRow,
                        left: box.leftCol,
                    }}
                ></div>
            );
        }
        return null;
    };

    return (
        <div className='center ma'>
            <div className="absolute mt2">
                <img id='inputimage' alt='' src={imageUrl} width='700px' height='auto'></img>
                {renderBoxes()}
            </div>
        </div>
    );
}

export default FaceRecognition;
